First I'm sorry for posting in rifles but it seems my only way of geting out to the community 
Fox tactical brand dark earth tactical vest, full of trinket pouches, large and small relocatable magazine pouches, with neck support coller. {100.00 value} these are hard to find, i was lucky to find one in store  while back! ...seriously...find one online. Good luck. This is real deal, swat style (not ballistic, but adjustable for under armor, AGAIN I STRESS THIS IS IN NO WAY A BULLET PROOF VEST, NOR INSERTABLE ARMOR OR BALLISTIC....this will not stop a BULLET!)

next i have a voodoo tactical brand soft gun case ,for either a shot gun or would work for a rifleas well....you could almost fit 2 rifles. it has pouches on the front and a ton of shell holders all around. digital urban/field camo. never had a gun in it, kinda was a back up case { value 80.00}

one nokaoi solution brand MICRO RED DOT SIGHT. this is not a cheap red dot this is a very nice and easily sighted piece. this sight is desighned for the 2 eye open method with enhances situational awarness. it is selectable 5x power red or green dot, and weighs very little. it features the parallex-free desighn wich allows the dot to fallow the movement of the users eye wich eliminates the need for "centering" . the manufacture date on this is sept 20th 2011, and nokaoi is a local lakewood company! i got it new at the last gun show, has been mounted but not sighted or fired with. {100.00 value) if unfarmiliar, it resembles the "reflex sight " in call of duty black ops but make no mistake it is not a reflex sight by anymeans.

i also have a quick rail release/mount style tact light, extremly bright white with multi lenses included {25 .00 value}

feel free to email with offers would like a decent plinker or other frms but am open to other trades,  would like equal or lesser value shotgun/22/.380 something in there . I have some great items, enquire for more pics .
